import React from 'react';
import Headroom from 'react-headroom';

import Nav from './Navbar';
import Menu from "./Menu" ;
import Fed from "./Feds" ;
import Searchs from './Searchs';
import './Main.css'

function Main() {
  return (
    <div className="Main">
        <div className='Heads'>
          <Headroom pinStart={50} >
            <Nav />
            </Headroom>
        </div>
        <div className='Bodys'>
        <Headroom pinStart={50} >
            <Menu />
            </Headroom>
            <Fed />
            <Searchs />
        </div>
        
      
    </div>
  );
}

export default Main;
